.Tab .title {
    transition: margin-left 300ms ease;
}
.Tab:hover {
    --tabs-inner-gap: 8px;
}
.Tab:hover .title {
    margin-left: 8px;
}

.Tab[data-discarded="true"] .title {
    opacity: 80%;
}

.Tab[data-parent="true"][data-folded="false"] + .Tab .body::after, .Tab[data-edit="true"] + .Tab .body::after {
		background-image: linear-gradient(0deg,var(--tabs-normal-fg)0,var(--tabs-normal-fg));
}


.Tab .body::after {
		top: unset;
}
